import './footer.css';

export default function Footer() {
  return (
    <footer className="footer">

    <section className="container">

    <p className="copyright">&copy; <a href="https://twitter.com/liran_tal">Liran Tal</a>. Design: <a href="https://html5up.net">HTML5 UP</a>.</p>

    </section>

    </footer>
  )
}
